import sunset from "./images/sunset.jpeg";
import lotus from "./images/lotus.jpeg";
import tree from "./images/tree.jpeg";

export const pinsData = [
  { image: sunset, title: "Beautiful Sunset", category: "Travel" },
  { image: lotus, title: "Lotus Bloom", category: "Nature" },
  { image: tree, title: "Green Tree", category: "Nature" },
  {
    image: "https://images.unsplash.com/photo-1504674900247-0877df9cc836",
    title: "Delicious Food",
    category: "Food",
  },
  {
    image: "https://images.unsplash.com/photo-1507525428034-b723cf961d3e",
    title: "Ocean View",
    category: "Travel",
  },
];
